// src/components/NewsList.js
import React from 'react';

function NewsList({ news }) {
  return (
    <div>
      {news.map((item) => (
        <div key={item.id}>
          <h2>{item.title}</h2>
          <p>{item.content}</p>
        </div>
      ))}
    </div>
  );
}

export default NewsList;
